INSERT INTO `Card_Notes` VALUES (5,'19/10/2015 01:57:24','test test test test test test test test test test test test test test test test test test test test test test test test test test test test test test test test test test test test test test test test test test test test test test test test test test test test test test test test test test test test test test test test test test test test test test test test test test test test test test test test test test test test test test test test test test test test test test test test test test test test test test test test test test ',3),(5,'19/10/2015 01:57:33','test test test test test test test test test test test test test test test test test test test test test test test test test test test test test test test test test test test test test test test test test test test test test test test test test test test test test test test test test test test test test test test test test test test test test test test test test test test test test test test test test test test test test test test test test test test test test test test test test test test test test test test test test test ',4),(5,'19/10/2015 02:01:22','\'bad data rate\'',5),(5,'19/10/2015 02:03:35','test',6),(5,'19/10/2015 02:06:51','testtest',7),(3040000000000500598,'19/10/2015 02:11:33','This card suffers from the back link issue.  We are seeing that the second link has the correct orbit rate, but always has a non-zero bad-data rate.  The align BCN was also systematically higher for this fiber, which is typical of links that suffer from this problem.   After swapping VTTx modules, the align BCN seemed to go back to the same value as the other, but still there was a non-zero bad-data rate.  After a minute or two, the align BCN went back to being about 3 higher than the other channels.',8),(3040000000000500598,'19/10/2015 02:43:25','this is a test, only a test',9),(3040000000000500601,'19/10/2015 09:54:56','card moved to charm for radiation testing.  3 VTTx modules went with it.',10),(3040000000000500602,'19/10/2015 09:55:28','card moved to CHARM for radiation testing.  3 VTTx modules went with it.  ',11),(3040000000000500587,'20/10/2015 10:41:05','This card previously had problems installing the IGLOO firmware. We never investigated why. Today, we were able to program it.',12),(3040000000000500596,'20/10/2015 12:35:29','When we try to get the unique ID, we get the value \"1 0xc1000000 0xb9ed1c70\".',13),(3040000000000500594,'20/10/2015 03:02:50','Second link of this card is suffering from the bad link issue.  Its align BCN is 3505 while the other links are 3502.  The card is currently plugged into rack 1 crate 4. ',14),(3040000000000500587,'20/10/2015 03:06:13','This link is suffering from the bad link issue.  Link two has align BCN of 3505 while the rest have 3502 and cant synchronize.  This card is in rack 1, crate 3, slot 11. ',15),(3040000000000500587,'20/10/2015 03:24:02','started having trouble with link 5.  Orbit rate is a little low and the align BCN jumped to 3505.',16),(3040000000000500593,'20/10/2015 05:22:08','This card has two unstable links.',17),(3040000000000500597,'20/10/2015 06:25:36','Tote observed issues reading registers by hand on this card. For example, he could not read FW versions of any of the FPGAs, nor the unique ID.',18),(3040000000000500603,'21/10/2015 03:16:38','Pre-production card from Brazil.',19),(3040000000000500597,'22/10/2015 11:14:32','This card is having strange communication problems.  We get an error when we try to read registers: ERROR!! I2C: LBA.  Switching the slot that the card was in with no change.  We did see an intermittent success with the unique ID register, but mostly we cant read anything.  We checked igloo, QIE, and bridge registers.  All failed.',20),(2,'22/10/2015 11:40:18','\'test\'',21),(2,'22/10/2015 11:51:36','something \'test\"\'',22),(2,'22/10/2015 11:52:01','something \'test\"\'',23),(3040000000000500596,'22/10/2015 05:53:49','using this card to test a new version of the igloo2 F/W.  The top FPGA has a custom version that is currently stored on the window computer in 904: Local Disk/HF_Firmware_904/HF_RM_igloo2.  This new version uses the backplane BC0 signal for the link test modes (when in link test mode 1).  This improves the link issues while in link test mode, but still there are some instabilities.  We also enable the debug pin 2 (3rd pin) to be the BC0 signal for testing whether or not this is synchronized with the backplane signal.',24),(3040000000000500596,'23/10/2015 04:08:33','Also noticed that the unique ID for this board is 0xc1000000 0xb9ed1c70.  It seems that there is an issue with reading the unique ID the first few time...',25),(3040000000000500595,'27/10/2015 04:59:00','We noticed with \'605 that switching the FE slot solved this ICI problem (we moved it from Rack 1, Crate 3: HF6-2 to HF6-5). We should try that with this.',26),(3040000000000500605,'09/11/2015 09:09:18','This card, from now on known as Sputnik, has been sent to p5 to be the first QIE10 card to be installed into UXC.  Along with it went 1 VTTX module, sn 001055, and a pigtail. ',27),(3040000000000500618,'11/11/2015 10:58:22','I am having trouble reading the unique ID when this is in Rack 1, Crate 4.',28),(3040000000000500694,'11/11/2015 12:44:56','This cards was tested with a two different ngCCMs in different slots, but in no cases were we able to communicate with the unique ID, the igloos, or the QIE registers.   This card needs some detailed investigation of the i2c lines.',29),(3040000000000500694,'11/11/2015 01:05:56','Checked the i2c input lines of this card with a scope.  The clock looks fine.  On power up, we see that the data line is high, like it should be, but after the first i2c command, the data line just goes low and stays low.  If the card is power cycled, this effect is repeatable.  ',30),(3040000000000500716,'12/11/2015 03:26:06','Tote pulled this board out of the crate (Rack 1, Crate 4) while the power was on.',31),(3040000000000500595,'13/11/2015 01:18:57','Moving this card down to the calibration test stand for Danny to exercise his calibration procedure',32),(3040000000000500583,'13/11/2015 01:19:29','Moving this card down to the calibration test stand for Danny to work with.',33),(3040000000000500664,'16/11/2015 11:28:08','The I2C line can occasionally be broken (held low) by attempting to read from the iTop registers. A backplane reset does not seem to recover the data line, but attempting to read from a non-iTop register has a chance of pulling the data line back high.',34),(3040000000000500694,'16/11/2015 11:30:53','We can reliably drive the I2C line low by issuing a \'get ...UniqueID\' call. The data line seems to recover after a bkp_reset pulse. -Joseph',35),(3040000000000500737,'16/11/2015 11:32:06','The I2C data line can be driven low reliably with \'get ...UniqueID\' or occasionally by \'get ...iTop...\'. A backplane reset seems to recover the data line. -Joseph',36),(3040000000000500712,'16/11/2015 01:20:57','Suffers from both UniqueID and iTop issue. Does not seem to be fixed by a backplane reset. -Joseph',37);
