INSERT INTO `Test_Type` VALUES (1,'raw ped',1,'mean/rms of raw peds','check the mean and RMS of pedestal distributions for all QIEs when no cable is plugged into the board.',1),(3,'register test',1,'check all registers','loop over all availble r/w registers on QIE card and write random bits ad readback to double check',2),(4,'link pattern',1,'','Enable link pattern readout in igloo two and check the integrity of the link',3),(5,'cap ID rotation',1,'check that cap are rotating','check that cap IDs for each group of 4 (12?) QIE are rotating correctly.  This should be checked at every clock phase possible.',4),(9,'Visual Inspection',1,'Check board for damage','Check board for damage, obvious short, or other potentially alarming features',1),(10,'Assembly check',1,'Check that all required parts are on the board.','Check that 3 VTTx modules 5 DC/DC converters are in their proper location, 2 Winchester PCB connectors, front panel, and Bridge JTAG pass-through are installed.  ',1),(11,'Ground-short test',1,'check voltage between all test points.','Check Power; using ohmmeter, check for shorts on between any of the voltage rails; there are easy to access test points for all rails; If a short is found, STOP and find the cause.  Record all voltages in comments.',1),(12,'Crate Power Test',1,'Install board into crate and check power.','Install Board into unpowered crate. Power Board, voltage should be ~8V.  Note power draw (expect ~1.6 A) in comments.  Quick check of components to verify no hot areas (should use an IR gun, if possible).\r\n',1),(15,'Check f/w versions',1,'','Using QA test suite s/w readout FPGA f/w versions.  Verify, they are as expected.  Note output in comments.',1),(21,'Internal Q Inj.',1,'','Using the QA test suite s/w run the CI test.  Attach root file with comments.  ',1),(22,'Program FPGA',1,'','use JTAG programmers and Xilinx/Microsemi s/w to load f/w onto the Bridge and both IGLOO2 FPGAs. Verify programmer was successful.',1),(23,'Calibration',1,'','use external charge injection scans for measuring QIE response.  Measure range select errors.  Calibrate TDC thresholds.',1),(24,'LED test',1,'','test QIE with fast external pulses using an LED + PMT to generate signals.',1);
